import './navbar.css'
import {useState, useEffect} from 'react'
import {Link} from "react-router-dom";
import Axios from 'axios'

import Profile from '../profile/Profile';
import Post from '../post/Post';

export default function Navbar({setCreatePostWindow, user}) {
    Axios.defaults.withCredentials = true;

    const [active, setActive] = useState(false);
    const [profileDropdownMenu, setProfileDropdownMenu] = useState(false);


const logout = () => {
    try{
    Axios.post('http://localhost:3001/api/auth/logout')
    .then((response) => {
    window.location.reload();
    })} catch(err){console.log(err)}
}

    return (
        <div className='navbar'>
            <div className="navbar-wrapper">
                <h1>Instagram</h1>
                <input type="text" name="" placeholder='Search' id="" className="searchbar" />
                <div className="option-menu">

               {active ?  <svg className='option-menu-icon' aria-label="Home" color="#262626" fill="#262626" height="24" role="img" viewBox="0 0 24 24" width="24"><path d="M22 23h-6.001a1 1 0 01-1-1v-5.455a2.997 2.997 0 10-5.993 0V22a1 1 0 01-1 1H2a1 1 0 01-1-1V11.543a1.002 1.002 0 01.31-.724l10-9.543a1.001 1.001 0 011.38 0l10 9.543a1.002 1.002 0 01.31.724V22a1 1 0 01-1 1z" strokeWidth="2"></path></svg>
               : <Link to='../'> <svg className='option-menu-icon' aria-label="Home" color="#262626" fill="#262626" height="24" role="img" viewBox="0 0 24 24" width="24"><path d="M9.005 16.545a2.997 2.997 0 012.997-2.997h0A2.997 2.997 0 0115 16.545V22h7V11.543L12 2 2 11.543V22h7.005z" fill="none" stroke="currentColor"  strokeWidth="2"></path></svg></Link>}


                <Link className='link-non-dec' to="../messenger">
                <div className="messages-icon option-menu-icon">
                <svg aria-label="Messenger" color="#262626" fill="#262626" height="24" role="img" viewBox="0 0 24 24" width="24"><path d="M12.003 2.001a9.705 9.705 0 110 19.4 10.876 10.876 0 01-2.895-.384.798.798 0 00-.533.04l-1.984.876a.801.801 0 01-1.123-.708l-.054-1.78a.806.806 0 00-.27-.569 9.49 9.49 0 01-3.14-7.175 9.65 9.65 0 0110-9.7z" fill="none" stroke="currentColor" strokeMiterlimit="10" strokeWidth="1.739"></path><path d="M17.79 10.132a.659.659 0 00-.962-.873l-2.556 2.05a.63.63 0 01-.758.002L11.06 9.47a1.576 1.576 0 00-2.277.42l-2.567 3.98a.659.659 0 00.961.875l2.556-2.049a.63.63 0 01.759-.002l2.452 1.84a1.576 1.576 0 002.278-.42z"></path></svg>
                <div className="messages-icon-label">1</div>
                </div></Link>


                <svg onClick= {()=>
